urf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",ldc='Dienstag',syc='Dimension',kkc='Dimension [height=',Iuc='DirectionalTextHelper',Bdc='Do',udc='Do.',Luc='DockLayoutPanel',Muc='DockLayoutPanel$Direction',Nuc='DockLayoutPanel$Direction;',Quc='DockLayoutPanel$DockAnimateCommand',Ouc='DockLayoutPanel$LayoutData',Rqc='DomEvent',Wqc='DomEvent$Type',ndc='Donnerstag',axc='Double',lhc='EAST',wac='EEE, d MMM yyyy HH:mm:ss Z',_mc='EEE. dd MMM. yyyy HH:mm:ss',Qac='EEEE d. MMMM',zac='EEEE, d. MMMM y',U8b='EM',pfc='EMPTY',ufc='ENABLED',Odc='END',W8b='EX',mtc='ElementMapperImpl',ntc='ElementMapperImpl$FreeNode',Occ='English',bqc='Enum',Fcc='Etc/GMT',Hcc='Etc/GMT+',Gcc='Etc/GMT-',n9b='Event type',gwc='Event$NativePreviewEvent',hrc='EventBus',opc='EventObject',tpc='Exception',Sfc='Expecting version 6 from server, got ',iac='F',ilc='F8834F07517EF3B7D02B9E845E5E1B88',P8b='FIXED',ogc=
